import './App.css';

function Register() {
  return (
    <div class="container page-content">
        <h4> Podaj dane:</h4>
        <hr></hr>
        <form method="post">
            <input type="text" placeholder="nazwa użytkownika" name="login"></input><br></br>
            <input type="email" placeholder="adres email" name="email"></input><br></br>
            <input type="password" placeholder="hasło" name="password"></input><br></br>
            <input type="password" placeholder="potwierdź hasło" name="password2"></input><br></br>
            <input type="submit"></input>
        </form>
    </div>
  );
}

export default Register;
